// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract Bidder {
  address public bidder;
  Auction public auctionAddr;

  constructor(Auction _auctionAddr, address _bidder) {
    auctionAddr = _auctionAddr;
    bidder = _bidder;
  }
}

contract Auction {
  address public auctioneer;
  string public auctionName;
  mapping(address => Bidder) public bidderContractMap;
  address[] public bidders;

  constructor(string memory _auctionName, address _auctioneer) {
    auctionName = _auctionName;
    auctioneer = _auctioneer;
  }

  function getAuctionName()
    view
    public
    returns(string memory)
  {
    return auctionName;
  }

  function getAuctioneer()
    view
    public
    returns(address)
  {
    return auctioneer;
  }

  function getBidders()
    view
    public
    returns(address[] memory)
  {
    return bidders;
  }

  function getBidderContract()
    view
    public
    returns(Bidder)
  {
    return bidderContractMap[msg.sender];
  }

  function joinAuction()
    public
    returns(Bidder)
  {
    Bidder newBidder = new Bidder(this, msg.sender);
    bidderContractMap[msg.sender] = newBidder;
    bidders.push(msg.sender);

    return newBidder;
  }
}

contract Main {
  address public owner = msg.sender;
  string public message;
  Auction[] public auctions;

  constructor() {
  }

  modifier ownerOnly() {
    require(
      msg.sender == owner,
      "This function is restricted to the contract's owner"
    );
    _;
  }

  function getAuctions()
    view
    public
    returns(Auction[] memory)
  {
    return auctions;
  }

  function createAuction(string memory _auctionName)
    public
    returns(Auction)
  {
    require(bytes(_auctionName).length > 0);

    Auction newAuction = new Auction(_auctionName, msg.sender);
    auctions.push(newAuction);

    return newAuction;
  }
}
